from typing import Dict, List, Set

#
# @lc app=leetcode id=30 lang=python3
#
# [30] Substring with Concatenation of All Words
#

# @lc code=start

class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        self.word_len = len(words[0])
        self.words = words
        self.subs_len = self.word_len * len(words)
        if self.subs_len > len(s):
            return []
        last_start = len(s) - self.subs_len

        occurrences = {}
        word_repeats = {}
        for w in words:
            if w not in word_repeats:
                word_repeats[w] = 0
            word_repeats[w] += 1
            if w in occurrences:
                continue
            else:
                occurrences[w] = []
            for i in range(len(s) - self.word_len + 1):
                for j in range(0, self.word_len):
                    if w[j] == s[i + j]:
                        if j == self.word_len - 1:
                            occurrences[w].append(i)
                    else:
                        break
        starts = {}
        for w, occs in occurrences.items():
            for i in occs:
                starts[i] = w

        subs_indices = []

        for start, _ in starts.items():
            if start <= last_start and self.test_from(start, starts, word_repeats):
                subs_indices.append(start)

        return subs_indices

    def test_from(self, start: int, starts: Dict[int, int], remaining_words: Dict[str, int]) -> bool:
        remaining_words = { k: v for k, v in remaining_words.items() }
        for i in range(start, start + self.subs_len, self.word_len):
            if i not in starts or remaining_words[starts[i]] == 0:
                return False
            remaining_words[starts[i]] -= 1
        return True

# @lc code=end

from test_utils import run_test

def test(s: str, words: List[str]):
    return set(Solution().findSubstring(s, words))
method = test

